        public List<HolidayResponse> SearchForHolidays(string countryCode, string year)
        {
            var client = new RestClient($"https://public-holiday.p.rapidapi.com/{year}/{countryCode.ToUpper()}");
            var request = new RestRequest(Method.GET);
            AddPublicHolidayApiHeaders(request);

            var response = client.Execute(request);

            if (!response.StatusCode.Equals(System.Net.HttpStatusCode.OK))
            {
                throw new TripAdvisorApiException($"Could not retrieve information from Public Holiday. Response code: {response.StatusCode}");
            }


            var holidaySearchResponse = JsonConvert.DeserializeObject<List<HolidayResponse>>(response.Content);

            return holidaySearchResponse;
        }

        public GeocodingResponse GetCountryCode(string latitude, string longitude)
        {
            var client = new RestClient("https://reverse-geocoding-to-city.p.rapidapi.com/data/reverse-geocode");
            var request = new RestRequest(Method.GET);
            request.AddQueryParameter("latitude", latitude);
            request.AddQueryParameter("longitude", longitude);
            request.AddQueryParameter("localityLanguage", "en");
            AddReverseGeocodingApiHeaders(request);

            var response = client.Execute(request);

            if (!response.StatusCode.Equals(System.Net.HttpStatusCode.OK))
            {
                throw new TripAdvisorApiException($"Could not retrieve information from Reverse Geocoding. Response code: {response.StatusCode}");
            }

            var geocodingResponse = JsonConvert.DeserializeObject<GeocodingResponse>(response.Content);

            return geocodingResponse;
        }
